package Coordinate;

public class CoordinateAssign {
	private int x;
	private int y;
	public CoordinateAssign(int x, int y) {
		super();
		this.x = x;
		this.y = y;
	}
	public CoordinateAssign() {
		super();
		// TODO Auto-generated constructor stub
	}
	@Override
	public String toString() {
		return "CoordinateAssign [x=" + x + ", y=" + y + "]";
	}
		
	
}
